  false,\n\t\"url\": null,\n\t\"notes\": \"Public authorities are required by Section
  2800 of Public Authorities Law to submit annual reports to the Authorities Budget
  Office that include real property transactions data.  The dataset consists of real
  property transactions reported by Local Development Corporations beginning with
  fiscal years ending in 2011. Authorities are required to report real property transactions
  having an estimated fair market of more than $15,000.\",\n\t\"license_title\": \"License
